import React from "react";
import Card from "../Card";
import "./style.css";

function CardContainer({lastname, firstname}) {
  return (
    <div className="jumbotron card-container">
      <Card lastname={lastname} firstname={firstname}/>
    </div>
  );
}

export default CardContainer;
